@use './shared' as *;
@use './design' as *;

.#{$namespace}-auto-complete {
  &__input {
    width: 100%;
    height: 100%;
    padding: 0;
    font-size: inherit;
    line-height: value('input-line-height');
    color: value('input-control-color');
    background-color: transparent;
    border: 0;
    border-radius: value('input-radius');
    outline: 0;

    &::placeholder {
      color: value('input-placeholder-color');
    }
  }
}
